import React from 'react'
import './Logo.css'
import Sc2 from './sc2.mp4'

export default function Logo () {
    return (
        <div className="logo-container">

            <video className='bgV' loop autoPlay>
                <source src={Sc2} type="video/mp4" />
            </video>
        </div>

    )
}
